import React from 'react';
import { Container, Navbar, Nav, Jumbot, Button } from 'react-bootstrap';
import { Jumbotron } from 'react-bootstrap';

const MaldivesLandingPage = () => {
  return (
    <div className="landing-page">
      <Navbar bg="light" expand="lg">
        <Container>
          <Navbar.Brand href="#home">Maldives Paradise</Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="ml-auto">
              <Nav.Link href="#about">About</Nav.Link>
              <Nav.Link href="#activities">Activities</Nav.Link>
              <Nav.Link href="#accommodation">Accommodation</Nav.Link>
              <Nav.Link href="#contact">Contact</Nav.Link>
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>

      <Jumbotron fluid className="hero">
        <Container>
          <h1>Welcome to the Maldives</h1>
          <p>Discover the beauty and serenity of the Maldives</p>
          <Button variant="primary">Learn More</Button>
        </Container>
      </Jumbotron>

      <section id="about" className="section">
        <Container>
          <h2>About the Maldives</h2>
          <p>
            The Maldives is a tropical paradise located in the Indian Ocean. It
            is famous for its crystal-clear waters, white sandy beaches, and
            vibrant coral reefs. With over a thousand islands to explore, the
            Maldives offers a range of activities for nature lovers, adventure
            seekers, and those looking to relax and unwind.
          </p>
        </Container>
      </section>

      <section id="activities" className="section">
        <Container>
          <h2>Activities</h2>
          <p>
            From snorkeling and diving to sunset cruises and beach parties, the
            Maldives offers a wide range of activities for all types of
            travelers. Explore the underwater world, indulge in spa treatments,
            or simply soak up the sun on the pristine beaches.
          </p>
        </Container>
      </section>

      <section id="accommodation" className="section">
        <Container>
          <h2>Accommodation</h2>
          <p>
            Experience luxury and comfort at the finest resorts in the Maldives.
            From overwater villas to beachfront bungalows, there are plenty of
            options to choose from. Enjoy world-class amenities, private pools,
            and stunning views of the ocean.
          </p>
        </Container>
      </section>

      <section id="contact" className="section">
        <Container>
          <h2>Contact</h2>
          <p>
            Have questions or ready to book your dream vacation? Get in touch
            with our friendly team for assistance and personalized
            recommendations.
          </p>
          <Button variant="primary">Contact Us</Button>
        </Container>
      </section>

      <footer className="footer">
        <Container>
          <p>&copy; 2023 Maldives Paradise</p>
        </Container>
      </footer>
    </div>
  );
};

export default MaldivesLandingPage;
